import { Player, Scene } from './game';

export const canvas = document.querySelector('canvas')!;
export const c = canvas.getContext('2d')!;

canvas.width = 1420;
canvas.height = 780;

c.fillRect(0, 0, canvas.width, canvas.height);

const background = new Scene({
  position: {
    x: 0,
    y: 0,
  },
  imageSrc: './images/konoha.png',
});

const player = new Player({
  position: {
    x: 0,
    y: 0,
  },
  velocity: {
    x: 0,
    y: 0,
  },
  color: 'pink',

  offset: {
    x: 0,
    y: 0,
  },
});

const enemy = new Player({
  position: {
    x: 400,
    y: 100,
  },
  velocity: {
    x: 0,
    y: 0,
  },
  color: 'cadetblue',
  offset: {
    x: -50,
    y: 0,
  },
});

const keys = {
  a: {
    pressed: false,
  },
  d: {
    pressed: false,
  },
  ArrowRight: {
    pressed: false,
  },
  ArrowLeft: {
    pressed: false,
  },
};

//i check if the player is in the range of attack on the x and y axes
function rectangularCollision({ rectangle1, rectangle2 }: any | number) {
  return (
    rectangle1.attackBox.position.x + rectangle1.attackBox.width >=
      rectangle2.position.x &&
    rectangle1.attackBox.position.x <=
      rectangle2.position.x + rectangle2.width &&
    rectangle1.attackBox.position.y + rectangle1.attackBox.height >=
      rectangle2.position.y &&
    rectangle1.attackBox.position.y <= rectangle2.position.y + rectangle2.height
  );
}

function determineWinner({ player, enemy, timerId }: any) {
  clearTimeout(timerId);
  ((document.querySelector(
    '#displayText',
  ) as unknown) as HTMLElement).style.display = 'flex';
  if (player.health === enemy.health) {
    ((document.querySelector(
      '#displayText',
    ) as unknown) as HTMLElement).innerHTML = 'Tie';
  } else if (player.health > enemy.health) {
    ((document.querySelector(
      '#displayText',
    ) as unknown) as HTMLElement).innerHTML = 'Player 1 Wins';
  } else if (player.health < enemy.health) {
    ((document.querySelector(
      '#displayText',
    ) as unknown) as HTMLElement).innerHTML = 'Player 2 Wins';
  }
}

let timer = 120;
let timerId: number;
function decreaseTimer() {
  if (timer > 0) {
    timerId = setTimeout(decreaseTimer, 1000);
    timer--;

    ((document.querySelector(
      '#timer',
    ) as unknown) as HTMLElement).innerHTML = timer.toString();
  }

  if (timer === 0) {
    determineWinner({ player, enemy, timerId });
  }
}

decreaseTimer();

//animation loop
console.log(background.image);

function animate() {
  window.requestAnimationFrame(animate);
  //background color
  c.fillStyle = 'black';
  c.fillRect(0, 0, canvas.width, canvas.height);
  background.update();
  player.update();
  enemy.update();

  player.velocity.x = 0;
  enemy.velocity.x = 0;

  // player movement
  if (keys.a.pressed && player.lastKey === 'a') {
    player.velocity.x = -5;
  } else if (keys.d.pressed && player.lastKey === 'd') {
    player.velocity.x = 5;
  }

  // Enemy movement
  if (keys.ArrowLeft.pressed && enemy.lastKey === 'ArrowLeft') {
    enemy.velocity.x = -5;
  } else if (keys.ArrowRight.pressed && enemy.lastKey === 'ArrowRight') {
    enemy.velocity.x = 5;
  }

  // detect for collision
  if (
    rectangularCollision({
      rectangle1: player,
      rectangle2: enemy,
    }) &&
    player.isAttacking
  ) {
    player.isAttacking = false;
    enemy.health -= 20;
    ((document.querySelector(
      '#enemyHealth',
    ) as unknown) as HTMLElement).style.width = enemy.health + '%';
  }

  if (
    rectangularCollision({
      rectangle1: enemy,
      rectangle2: player,
    }) &&
    enemy.isAttacking
  ) {
    enemy.isAttacking = false;
    player.health -= 20;
    ((document.querySelector(
      '#playerHealth',
    ) as unknown) as HTMLElement).style.width = player.health + '%';
  }

  // end game based on health
  if (enemy.health <= 0 || player.health <= 0) {
    determineWinner({ player, enemy, timerId });
  }
}

animate();

window.addEventListener('keydown', (event) => {
  switch (event.key) {
    case 'd':
      keys.d.pressed = true;
      player.lastKey = 'd';
      break;
    case 'a':
      keys.a.pressed = true;
      player.lastKey = 'a';
      break;
    case 'w':
      player.velocity.y = -20;
      break;
    case ' ':
      player.attack();
      break;

    case 'ArrowRight':
      keys.ArrowRight.pressed = true;
      enemy.lastKey = 'ArrowRight';
      break;
    case 'ArrowLeft':
      keys.ArrowLeft.pressed = true;
      enemy.lastKey = 'ArrowLeft';
      break;
    case 'ArrowUp':
      enemy.velocity.y = -20;
      break;
    case 'ArrowDown':
      enemy.attack();
      break;
  }
});

window.addEventListener('keyup', (event) => {
  switch (event.key) {
    case 'd':
      keys.d.pressed = false;
      break;
    case 'a':
      keys.a.pressed = false;
      break;
  }

  // enemy keys
  switch (event.key) {
    case 'ArrowRight':
      keys.ArrowRight.pressed = false;
      break;
    case 'ArrowLeft':
      keys.ArrowLeft.pressed = false;
      break;
  }
});
